import React from 'react';
import {Box, Center} from "@chakra-ui/react";

const QuestionDialog = () => {
    return (
       <Box width={'100vw'} height={'100vh'} bg={'black'}>
         <Center>
             <Box
                 transform={
                     'translateX(-50%)'
                 }
                 zIndex={9000}
                 position={'fixed'}
                 top={10} right={50}
                 minH={'800px'}
                 bg={'red'}
                 minW={'600px'}>
                 sdsd
             </Box>
         </Center>
       </Box>
    );
};

export default QuestionDialog;
